DROP TABLE IF EXISTS `product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product` (
  `id` int NOT NULL AUTO_INCREMENT,
  `authors` varchar(1000) DEFAULT NULL,
  `average_rating` float DEFAULT NULL,
  `amount` int DEFAULT NULL,
  `category_id` int DEFAULT NULL,
  `main_image` varchar(255) DEFAULT NULL,
  `original_publication_year` int DEFAULT NULL,
  `ratings_count` int DEFAULT NULL,
  `small_image` varchar(255) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `weighted_rating` float DEFAULT NULL,
  `price` float DEFAULT NULL,
  `discount` float DEFAULT NULL,
  `final_price` float DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `description` text,
  `stop_business` tinyint NOT NULL,
  `product_url` text,
  PRIMARY KEY (`id`),
  KEY `fk_category_idx` (`category_id`),
  CONSTRAINT `fk_category_product` FOREIGN KEY (`category_id`) REFERENCES `category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
