INSERT INTO `product` VALUES (1,'[\'suzannecollins\']',4.34,272,11743,'https://images.gr-assets.com/books/1447303603m/2767052.jpg',2008,4780653,'https://images.gr-assets.com/books/1447303603s/2767052.jpg','The Hunger Games (The Hunger Games, #1)',4.32837,1200,0.1,1080,NULL,'2021-06-10 17:00:00','Harry Potter là tên của series tiểu thuyết huyền bí gồm tám phần của nữ nhà văn Anh Quốc J. K. Rowling. Bộ truyện viết về những cuộc phiêu lưu phù thủy của cậu bé Harry Potter cùng hai người bạn thân là Ronald Weasley và Hermione Granger, lấy bối cảnh tại Trường Phù thủy và Pháp sư Hogwarts nước Anh. Những cuộc phiêu lưu tập trung vào cuộc chiến của Harry Potter trong việc chống lại tên Chúa tể hắc ám Voldemort – người có tham vọng muốn trở nên bất tử, thống trị thế giới phù thủy, nô dịch hóa những người phi pháp thuật và tiêu diệt những ai cản đường hắn, đặc biệt là Harry Potter.',0,'the_hunger_games_(the_hunger_games,_1)_1'),(2,'[\'j.k.rowling\', \'marygrandpré\']',4.44,491,8517,'https://images.gr-assets.com/books/1474154022m/3.jpg',1997,4602479,'https://images.gr-assets.com/books/1474154022s/3.jpg','Harry Potter and the Sorcerer\'s Stone (Harry Potter, #1)',4.42436,1200,0.1,1080,NULL,'2021-06-16 17:00:00',NULL,1,'harry_potter_and_the_sorcerer\'s_stone_(harry_potter,_1)_2'),(3,'[\'stepheniemeyer\']',3.57,226,28422,'https://images.gr-assets.com/books/1361039443m/41865.jpg',2005,3866839,'https://images.gr-assets.com/books/1361039443s/41865.jpg','Twilight (Twilight, #1)',3.58825,1200,0.1,1080,NULL,'2021-06-10 17:00:00',NULL,0,'twilight_(twilight,_1)_3'),(4,'[\'harperlee\']',4.25,487,14552,'https://images.gr-assets.com/books/1361975680m/2657.jpg',1960,3198671,'https://images.gr-assets.com/books/1361975680s/2657.jpg','To Kill a Mockingbird',4.23746,1200,0.1,1080,NULL,'2021-06-16 17:00:00',NULL,1,'to_kill_a_mockingbird_4'),(5,'[\'f.scottfitzgerald\']',3.89,1356,26138,'https://images.gr-assets.com/books/1490528560m/4671.jpg',1925,2683664,'https://images.gr-assets.com/books/149052